{\rtf1\ansi\ansicpg1252\deff0\deflang1036{\fonttbl{\f0\fnil\fcharset0 MS Shell Dlg;}}
\viewkind4\uc1\pard\f0\fs20 APPCO.com is the corporate web site. It provides a weath of  information on products and services.\par
It includes an online web store. Customers can place and track orders via this application.\par
}

{\rtf1\fbidis\ansi\ansicpg1252\deff0\deflang1036{\fonttbl{\f0\froman\fprq2\fcharset0 Times New Roman;}{\f1\fnil\fcharset0 MS Shell Dlg;}}
\viewkind4\uc1\pard\ltrpar\lang1033\f0\fs22 This Supply Chain Planning application enables APPCO to plan and design global supply chains effectively, while optimizing the flow of materials, resources, cash, and information. SCM keeps track of production parts ordered and consumed and informs the Production Activity Control System when Production parts are available.\lang1036\f1\fs20\par
}

{\rtf1\ansi\ansicpg1252\deff0\deflang1036{\fonttbl{\f0\fswiss\fprq2\fcharset0 Calibri;}{\f1\froman\fprq2\fcharset0 Times New Roman;}{\f2\fnil\fcharset0 MS Shell Dlg;}}
\viewkind4\uc1\pard\sa200\sl276\slmult1\lang1033\v\f0\fs22 ~DNMlUZSN51r4[\b\v0 Assembly management\b0\v ]\v0   is used to ensure that the necessary assembly parts arrive on the shop floor at the correct time. This application provides the capability to track the assembly parts consumed and to follow-up the production activity.\f1\par
\pard\lang1036\f2\fs20\par
}

