{\rtf1\fbidis\ansi\ansicpg1252\deff0\deflang1036{\fonttbl{\f0\froman\fprq2\fcharset0 Times New Roman;}{\f1\fnil\fcharset0 MS Shell Dlg;}}
\viewkind4\uc1\pard\ltrpar\lang1033\f0\fs22 This application provides accurate product demand visibility to generate reliable sales forecasts. These sales forecasts are used to plan production schedules. Production orders can also be created in the Demand Management application and for products made to stock.\lang1036\f1\fs20\par
}

{\rtf1\ansi\ansicpg1252\deff0\deflang1036{\fonttbl{\f0\fnil\fcharset0 MS Shell Dlg;}}
\viewkind4\uc1\pard\f0\fs20 This Application provides the Electronic Data Interface with the APPCO's suppliers.\par
}

{\rtf1\ansi\ansicpg1252\deff0\deflang1036{\fonttbl{\f0\fnil\fcharset0 MS Shell Dlg;}}
\viewkind4\uc1\pard\f0\fs20 LogiKS is an integrated CRM application that enables APPCO to manage product orders and view stock levels in real time. When stock levels are insufficient to meet demand, Production orders can be generated and sent to the Production Activity Control System.\par
}

{\rtf1\ansi\ansicpg1252\deff0\deflang1036{\fonttbl{\f0\fnil\fcharset0 MS Shell Dlg;}}
\viewkind4\uc1\pard\v\f0\fs20 ~jMMlAZSN5Hq4[\b\v0 Machine Maintenance Scheduler\b0\v ]\b\v0  \b0  uses automatically collected machine run time data to schedule maintenance, thereby reducing downtime due to unplanned maintenance issues.\par
}

{\rtf1\ansi\ansicpg1252\deff0\deflang1036{\fonttbl{\f0\fswiss\fprq2\fcharset0 Calibri;}{\f1\fnil\fcharset0 MS Shell Dlg;}}
\viewkind4\uc1\pard\sa200\sl276\slmult1\lang1033\f0\fs22 The \v ~WukHfOsI5Py1[\b\v0 Production Activity Control System\b0\v ]\v0  is comprised of three modules: \v ~wxkHGOsI5bx1[\b\v0 Production scheduling\b0\v ]\v0 ; \v ~DNMlUZSN51r4[\b\v0 Assembly management\b0\v ]\v0  and \lang1036\v\f1\fs20 ~jMMlAZSN5Hq4[\b\v0 Machine Maintenance Scheduler\b0\v ]\lang1033\v0\f0\fs22 . This system is used to manage the flow of materials inside the plant and to execute the production plans that minimize excess inventory while avoiding production bottleneck.\par
\pard\lang1036\f1\fs20\par
}

{\rtf1\fbidis\ansi\ansicpg1252\deff0\deflang1036{\fonttbl{\f0\froman\fprq2\fcharset0 Times New Roman;}{\f1\fnil\fcharset0 MS Shell Dlg;}}
{\colortbl ;\red0\green0\blue0;}
\viewkind4\uc1\pard\ltrpar\cf1\lang1033\v\f0\fs18 ~wxkHGOsI5bx1[\b\v0 Production scheduling\b0\v ]\v0   maximizes shop floor efficiency by optimizing production schedules. This application simulates production scenarios that are then used to determine which products should be manufactured to fulfill the production orders. It optimizes the usage of critical resources, calculates realistic and feasible schedules that the shop floor can execute, and determines the schedule that best meets production objectives.\par
\cf0\lang1036\f1\fs20\par
}

{\rtf1\ansi\ansicpg1252\deff0\deflang1033{\fonttbl{\f0\froman\fcharset0 Times New Roman;}{\f1\fnil\fcharset0 MS Shell Dlg;}{\f2\fnil\fcharset2 Symbol;}}
{\colortbl ;\red0\green0\blue255;}
\viewkind4\uc1\pard\sb100\sa100\f0\fs24 To best satisfy customers, you must provide the right products and services at the right price, to the right customer at the right time.To achieve this goal, you need to ensure the integration of the entire chain including design, development, procurement, manufacturing, sales, until the delivery of your products and services. But you also need the flexibility to simplify, automate, and innovate your processes in order to support new business requirements.\par
SAP ERP Operations provides your organization with complete features and functions to help you manage your key activities in: \par
\pard{\pntext\f2\'B7\tab}{\*\pn\pnlvlblt\pnf2\pnindent360{\pntxtb\'B7}}\fi-360\li720\sb100\sa100\cf1\ul Procurement and logistics execution </solutions/business-suite/erp/operations/featuresfunctions/procurementlogistics/index.epx>\cf0\ulnone  \endash  Manage end-to-end procurement and logistics business processes for complete business cycles, from self-service requisitioning to flexible invoicing and payment. SAP ERP Operations can also help optimize the physical flow of materials. \par
\cf1\ul{\pntext\f2\'B7\tab}Product development and manufacturing </solutions/business-suite/erp/operations/featuresfunctions/developmentmanufacturing/index.epx>\cf0\ulnone  \endash  Support the entire life cycle of product development and manufacturing. You can perform production planning, manufacturing execution integrated with shop-floor systems, product development, and life-cycle data management in a wide variety of industries. \par
\cf1\ul{\pntext\f2\'B7\tab}Sales and service </solutions/business-suite/erp/operations/featuresfunctions/salesservice/index.epx>\cf0\ulnone  \endash  Manage customer-focused activities, from selling products and services, to managing professional-services delivery and internal processes such as calculating incentives and commissions. \par
\pard\f1\fs20\par
}

{\rtf1\fbidis\ansi\ansicpg1252\deff0\deflang1036{\fonttbl{\f0\froman\fprq2\fcharset0 Times New Roman;}{\f1\fnil\fcharset0 MS Shell Dlg;}}
\viewkind4\uc1\pard\ltrpar\lang1033\f0\fs22 This is an inventory management application that controls maximum and minimum product stock levels and allows APPCO to set complex pricing rules based on individual customers, item variations and volume.\fs24  \lang1036\f1\fs20\par
}
